import { Component, AfterViewChecked, ElementRef, ViewChild, OnInit } from '@angular/core'

@Component({
    templateUrl: './chat.component.html'
})

export class ChatComponent implements OnInit, AfterViewChecked {

    @ViewChild('scrollBottom', { static: true }) private scrollContainer: ElementRef;
    isContentOpen: boolean = false;
    chatId: string;
    msg: string;
    chatList
    componentName= 'Mensagens'
    constructor() { }

    ngOnInit(){

            this.chatList = [{
                name:'Gabrielli Liria',
                msg: [{
                    avatar: '',
                    text: 'Marcos Sanches, quer ser meu padrinho?',
                    from: 'opposite',
                    time: '',
                    msgType: 'text'
                },{
                    avatar: '',
                    text: 'Claro que sim',
                    from: 'me',
                    time: '',
                    msgType: 'text'
                }],
                avatar:'data:image/jpeg;base64,'},
                {
                name:'Giovanna Lisboa',
                msg: [{
                    avatar: '',
                    text: 'Giovanna Lisboa, quer casar comigo?',
                    from: 'me',
                    time: '',
                    msgType: 'text'
                },{
                    avatar: '',
                    text: 'Claro que sim',
                    from: 'opposite',
                    time: '',
                    msgType: 'text'
                }],
                avatar:'data:image/png;base64,',
            }];
        this.chatId = 'Gabrielli Liria'
        this.scrollToBottom();
    }

    ngAfterViewChecked() {        
        this.scrollToBottom();        
    } 

    selectChat(index: string){
        this.chatId = index;
        this.isContentOpen = true;
    };

    closeChatContent() {
        this.isContentOpen = false;
    }

    sendMsg(msg: string) {
        for (let i = 0; i < this.chatList.length; i++) {
            if(this.chatId == this.chatList[i].name && this.msg.length > 1){
                this.chatList[i].msg.push(
                    {
                        avatar: '',
                        text: msg,
                        from: 'me',
                        time: '',
                        msgType: 'text'
                    }
                ) 
            }
        } 
        this.msg = '';   
    }

    scrollToBottom(): void {
        try {
            this.scrollContainer.nativeElement.scrollTop = this.scrollContainer.nativeElement.scrollHeight;
        } catch(err) { }                 
    }
}  